import React from "react";

function sayHello() {
  console.log("Hello");
}

const Header = () => {
  return <h1>Click the button</h1>;
};

class Button extends React.Component {
  render() {
    return <button onClick={sayHello}>Click Me</button>
  }
}

class App extends React.Component {
  render() {
    return(
      <>
        <Header /> <Button/>
      </>
    )
  }
}

export default App;
